function carSense = turnLanes()% This is a nested function which will read the Hall Effect sensors% to sense if a car is present at the turn lane.% Inputs: None% Local Outputs: None% Global outputs: [TLAseq, TLCseq] global TLAseq % Declare TurnLane Variables as global. global TLCseqt = gtime();[Error carTLA] = digitalRead(11); % If digitalRead is 1, sets carTLA to 0, and vice versa.[Error carTLC] = digitalRead(12);carSense = [carTLA, carTLC]; %Output for diagnostics.if t < 0.1  if carTLC == 0 % Read Hall Effect Sensor (activates at zero).  TLCseq = 1;  endelseif 20.9 < t < 21  if carTLA == 0  TLAseq = 1;  endendend